So, HUGE thanx to to a special friend for granting me her on demand access to I could rip the new Talking Dead episode from the amc website. This is NOT like the previous posts of mine where it was horrible quality. I couldn't capture the stream because its encrypted but was able to do a screen rip. there is an occasional shudder in the video frame rate but overall it's decent. it is just a talk show and the interview with the Governor is awesome, so enjoy my fellow &quot;walkers&quot; :)

